ght intensity has a positive correlation with sleep, whereas the results for fair or high intensity are both negative.\n"]},{"cell_type":"markdown","id":"367ff90f","metadata":{"papermill":{"duration":0.110272,"end_time":"2023-04-11T11:03:25.605096","exception":false,"start_time":"2023-04-11T11:03:25.494824","status":"completed"},"tags":[]},"source":["## Insights and Recommendations for Coach App:\n","1. Full-time workers often struggle to find time to build a workout routine. \n","2. Even those who do engage in higher intensity activities, don't necessarily enjoy better sleep. This could be due to chronically elevated cortisol levels brought about by stress.\n","\n","Most comprehensive tracking apps provide data on:\n","\n","* BMI\n","* Weight\n","* Bone density\n","* Bodyfat & visceral fat\n","* Muscle mass\n","* Calories\n","* HRV\n","* Activities\n","* Sleep\n","\n","Bellabeat has the advantage of tailoring their metrics to women by including data on menstrual cycle. Other metrics one might consider are:\n","\n","* Sun exposure: in addition to the increase in vitamin D, exposure to sunlight also helps release nitric oxide; a molecule crucial for vascular health.[source](https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7400257/)\n","* Nature exposure: benefits include improved cognitive and cardiovascular function. [source](https://www.ncbi.nlm.nih.gov/pmc/articles/PMC8125471/)\n","* Social support: a 2021 observational study shows the positive benefits of social support during Covid pandemic.[source](https://bmcpsychiatry.biomedcentral.com/articles/10.1186/s12888-020-03012-1)\n","* Meditation: a 2019 experimental study shows that meditation can significantly reduce anxiety, depression and rumination scores.[source](https://www.frontiersin.org/articles/10.3389/fnhum.2019.00208/full)\n","\n","As the preventive healthcare industry continues to grow, data-driven personalized health recommendations will become the norm. The question, however, is can the gadgets that make us sedentary and stressed out also make us active and resilient? A virtual coach can help the user keep track of all her data but sometimes one needs a human touch for real behavioral change. Women especially crave communal support.\n","\n","Action:\n","1. Include recommended metrics \n","2. Allow users to connect with their friends on Coach App for cummunal support\n","3. Host webinars to connect with strong femal health professionals or social media ambassadors to promote the brand\n","\n","By incorporating comprehensive tracking data with a strong social networking component will ensure BellaBeat stay competitive in the HealthTech industry. \n","\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":13.589993,"end_time":"2023-04-11T11:03:25.822699","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-04-11T11:03:12.232706","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}